import React from 'react'
import FeedItem from './feedItem'

let style = {
    overflow: 'scroll'
}

let feedTestRandom = () => {
    console.log('abc')
    return (<FeedItem>ABCDEF</FeedItem>)
}

const unregisteredFeed = () => {
    return(
    <div style={style}>
        {setInterval(feedTestRandom, 3000)}
    </div>)
}

export default unregisteredFeed
